  input: TEXT,F3XA,,"Amendment filed in response to RFAI dated January 10, 2007.  One
    of the $5,000 contributions from Arthur Lipson was erroneously reported, and has
    been correctly attributed to his spouse, Rochelle Kaplan.  One of the $5,000 contributions
    from Peter Neumeier was erroneously reported, and has been correctly attributed
    to his spouse, Gillian Neumeier.  The payment to Gold Communications on October
    6, 2006, in the amount of $44,359.40 has been corrected to accurately split the
    payment between Madrid, Tester, Casey, and Sestak, as originally reported on 24
    Hour notices dated September 25 and October 3; those payments were subsequently
    voided and re-cut on October 6, 2006.   The payment to Gold Communications on
    Oct. 16 in the amount of $29,824.33 has now been reported on a 24 Hour notice.   The
    payment to The Element Agency dated Oct. 11 in the amount of $5,308.59 has now
    been updated to correctly report the beneficiary as Maria Cantwell, bringing it
    in line with the 24 Hour notice submitted at the time of payment.   The corrections
    made on the October Monthly report and this Pre-General report will correct the
    Calendar Year-to-Date numbers for the elections cited.  It should be noted that
    the FECFile software does not differentiate between primary and general elections
    and therefore calculates for the complete calendar year. "
